import Vue from 'vue'
import App from './App.vue'
import SuiVue from '../node_modules/semantic-ui-vue';

//引入qs模块
import qs from '../node_modules/qs'
Vue.prototype.$qs = qs
Vue.config.productionTip = false
Vue.use(SuiVue);

new Vue({
  render: h => h(App),
}).$mount('#app')
